import React from 'react';
import Navbar from './components/Navbar/Navbar.jsx';
import HomePage from './components/Home/Home.jsx';
import AboutMe from './components/AboutMe/AboutMe.jsx';
import Projects from './components/Projects/Projects.jsx';
import ChatPage from './components/ChatAI/Chat.jsx';
import './App.css';
import { BrowserRouter } from 'react-router-dom';

function App() {

  return (
    <BrowserRouter>
    <div className="app">
     <nav className="navbar">
      <Navbar />
      </nav>

        {/* Sections with unique ids for scrolling */}
        <div id="home" className="section">
          <HomePage />
        </div>

        <div id="aboutme" className="section">
          <AboutMe />
        </div>

        <div id="projects" className="section">
          <Projects />
        </div>

        <div id="chat" className="section">
          <ChatPage />
        </div>
        <div className="background-row">
          <img src="/assests/bcc.png" alt="monkey" id="mon3" className="monkey-img home" />
          <img src="/assests/bc3.png" alt="monkey" id="mon2" className="monkey-img aboutme" />
          <img src="/assests/bcc2.png" alt="monkey" id="mon4" className="monkey-img projects" />
          <img src="/assests/bc2.png" alt="bmonkey" id="mon1" className="monkey-img chat" />
        </div>

      </div>
    </BrowserRouter>
  );
}

export default App;
